goeie film

met Edward Norton, Colin Farrell en Noah Emmerich

De New Yorkse politieagent Ray Tierney, heeft zich jarenlang teruggetrokken uit het korps, nadat hij in een schandaal verwikkeld
raakte. Wanneer vier van zijn oude collega's, die onder bevel van zijn broer Francis stonden, bruut worden vermoord, besluit Ray
zich weer met het korps en het onderzoek naar de moord te bemoeien. Ook zijn zwager Jimmy, tevens werkend in hetzelfde korps,
blijkt een aandeel in de zaak te hebben.
